import './App.css';
import React from 'react';

import axios from 'axios';

function App() {
  const identityPerson = document.getElementById("firstandlast");
  const zipcodeText = document.getElementById("zipcode");

  const onSubmit = (e) => {
    e.preventDefault();

    axios.post('http://localhost:5000/api/postdetails', {headers}, { 
      identity: identityPerson, //sending JSON object
      zipcode: zipcodeText}
    )
    .then(response => response.json())
    .catch(err => console.log(err))
  }

  const headers = {
    'Accept': 'application/json', 
    'Content-Type': 'application/x-www-form-urlencoded' 
  };

  return (
    <div className="center">
      <form onSubmit={onSubmit} className="Form">
        <input type="text" id="firstandlast" className="inputbox" placeholder="First and Last Name" />
        <input type="text" id="zipcode" className="inputbox" placeholder="ZIP code" />
        <button value="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
